	(1, 'Siem Reap', 'is gothic grandeur by the river', '<h4 class="font-size-21 font-weight-semi-bold text-gray-6 pb-1">Time Travel</h4>\r\n<p>Immersed in history, London\'s rich seams of eye-opening antiquity are everywhere. The city\'s buildings are striking milestones in a unique and beguiling biography, and a great many of them &ndash; the Tower of London, Westminster Abbey, Big Ben &ndash; are instantly recognisable landmarks. There&rsquo;s more than enough innovation (the Shard, the Tate Modern extension, the Sky Garden) to put a crackle in the air, but it never drowns out London&rsquo;s seasoned, centuries-old narrative. Architectural grandeur rises up all around you in the West End, ancient remains dot the City and charming pubs punctuate the historic quarters, leafy suburbs and river banks. Take your pick.</p>\r\n<p>Once inside the historic palace located on the Right Bank of the Seine, see unmissable and iconic sights such as the Mona Lisa and Venus de Milo. Discover masterpieces of the Renaissance and ancient Egyptian relics, along with paintings from the 13th to 20th centuries, prints from the Royal Collection, and much more.</p>', 'siemreap', 240, '48.856613', '2.352222', 12, 'publish', 1, 2, NULL, 1, 1, NULL, NULL, NULL, '2021-12-03 15:01:55', '2021-12-07 02:35:23', 240, '""'),
	(2, 'Phnom Penh', NULL, '<p>New York, a city that doesnt sleep, as Frank Sinatra sang. The Big Apple is one of the largest cities in the United States and one of the most popular in the whole country and the world. Millions of tourists visit it every year attracted by its various iconic symbols and its wide range of leisure and cultural offer. New York is the birth place of new trends and developments in many fields such as art, gastronomy, technology,...</p>', 'phnompenh', 244, '48.856613', '2.352222', 12, 'publish', 3, 4, NULL, 1, 1, NULL, NULL, NULL, '2021-12-03 15:01:55', '2021-12-07 02:36:35', 244, '[{"image_id":"112","title":"Experiencing the best jazz in Harlem, birthplace of bebop","link":"#","content":"New Orleans might be the home of jazz, but New York City is where many of the genre\\u2019s greats became stars \\u2013 and Harlem was at the heart of it.The neighborhood experienced a rebirth during the..."},{"image_id":"113","title":"Reflections from the road: transformative \\u2018Big Trip\\u2019 experiences","link":"#","content":"Whether it\\u2019s a gap year after finishing school, a well-earned sabbatical from work or an overseas adventure in celebration of your retirement, a big trip is a rite of passage for every traveller, with myriad life lessons to be ..."}]'),
